import { useState } from "react";

interface Props {
  onClick?: () => void;
}

const Strategie = ({ onClick }: Props) => {
  const [showList, setShowList] = useState(false);

  function handleButtonClick() {
    setShowList(!showList);
    if (onClick) {
      onClick();
    }
  }
  const strats = [
    "Minimizzazione",
    "Occultamento",
    "Aggregazione",
    "Separazione",
    "Dimostrazione",
    "Indormazione",
    "Rafforzamento",
    "Controllo",
  ];
  return (
    <>
      <button onClick={handleButtonClick}>Strategie</button>
      {showList && (
        <ul>
          {strats.map((strat, index) => (
            <li key={index}>{strat}</li>
          ))}
        </ul>
      )}
    </>
  );
};

export default Strategie;
